          <img className='overview-logo' src={overviewImg} alt="Not Found" />
          <Link to="/">Overview</Link>
        </div>

        {/* <div className='logo2'>
          <img className='location-logo' src={location} alt="Not Found" />
          <Link to="EmployeeView">Employee View</Link>
        </div> */}
      </nav>
    </div>
  );
}

export default Sidebar;
